INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(1, 'La légende du Titanic', 'Poussé par l\'insistance des petits-enfants qui exténuantes lui montrer une copie du Times du lointain 1912, Top Connors, souris grand-papa, commence à raconter l\'histoire de titanesque et son équipage. Avec un flash-back de retour au 10 Avril 1912, le jour du départ du port du Titanic Southampton.', 1999, 2.99, 84, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(2, 'Simba,  Le Lion Roi', 'À la suite de la mort de son père, Simba se doit de reprendre le trône afin de devenir le roi de la savane. Pour l\'aider dans son périple, des fées lui confient le pouvoir de la Grande Ourse. Le jeune lionceau entouré de son fidèle ami Bimbo, jeune faon destiné à devenir le roi de la forêt, mais aussi de Bagherra, Baloo, Kaâ et bien d\'autres, rencontrera de nombreux pièges du vil tigre Sher-Khan…', 1995, 4.99, 90, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(3, 'Almighty Thor', 'Quand le maléfique dieu Loki parvient à s\'emparer du marteau d’invincibilité, l\'ombre de la destruction plane sur le monde. Seul le jeune Thor, dont le père et le frère ainé ont été tué par Loki, a le pouvoir d\'arrêter ce dernier. Entrainé par la valkyrie Jarnsaxa, Thor part à la recherche du fameux marteau.', 2012, 3.99, 87, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(4, 'Le Prince des Dinosaures', 'Rejoignez Rakhal, prince de la terre de glace, et ses cinq amis dinosaures dans un voyage pour trouver la signification d\'un ancien parchemin. Les amis doivent libérer la princesse Aura et ramener la paix sur le pays dans ce long métrage d\'animation de haute qualité.', 2000, 1.99, 80, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(5, 'La légende de Zorro', 'Au xixe siècle, un jeune noble californien, Don Diego de la Vega, décide de combattre l\'injustice sous le nom de « Zorro », car l\'armée espagnole profite abusivement des biens du peuple.', 1996, 2.99, 92, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(6, 'Aladin et la Lampe magique', 'Un jeune voleur des rues de Bagdad trouve une lampe magique capable d\'exaucer ses voeux les plus fous. Il l\'utilise pour se transformer en Prince et séduire la Princesse.', 1992, 1.99, 40, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(7, 'The Toys Room', 'Dans la chambre des enfants, les jouets sont assis déprimés dans le coin. Le garçon a un nouveau jouet pour son anniversaire. Et maintenant, il ignore complètement ses vieux jouets. Pino, la vieille poupée préférée, est désespéré, car au lieu de lui, la \"nouvelle\" peut rejoindre le petit garçon au lit. Quand tout le monde dort, Pino décide de s\'enfuir et de ne jamais, jamais revenir. Le lendemain matin, Knuddel, le cuddlecushion, découvre que Pino a disparu. Le Skateboard prend le commandement a', 1996, 4.99, 45, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(8, 'Dinausores', 'Dans un monde où les dinosaures cohabitent avec les gorilles, les gazelles et d\'autres animaux, deux dinosaures attendent que leur œuf éclose. Lorsque l\'œuf éclose enfin, un dinosaure sort, et ils décident de l\'appeler \"Tio\".', 2001, 2.99, 42, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(9, 'Transmorphers', 'La planète est en danger: un groupe de robots venus d\'une autre planète envahit celle des humains. Face à la force des androïdes, les survivants doivent fuir. Autour du shérif Hadley Ryan, du Dr. Jo Summers et du soldat Jake Van Ryberg, une résistance se forme pour reprendre le contrôle de la planète face à l\'ennemi.', 2007, 3.99, 82, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(10, 'Transmorphers: Fall of Man', 'Dans cette préquelle actuelle, les envahisseurs robots attaquent la Terre, forçant un petit groupe d\'humains à chercher refuge sous la surface de la planète.', 2009, 3.99, 86, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(11, 'Sunday School Musical', 'Zachary appartient à la chorale de son lycée, qualifiée pour une très importante compétition. Mais sa famille doit déménager, et le jeune garçon est obligé de quitter son lycée, ses camarades et \" sa \"chorale. Dans son nouveau lycée, Zachary a du mal à se faire des amis. Il y retrouve néanmoins une chorale, bien moins bonne que celle qu\'il vient d\'abandonner. Zachary va prendre les choses en main et apporter sons sens du rythme et du chant. En faisant cela, Zachary a-t-il trahi ses anciens camar', 2008, 4.99, 90, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(12, 'Paranormal Entity', 'Samantha, son grand frère Thomas et leur mère Ellen sont une famille qui vient de perdre leur père il y a un an. Ellen essaye de rentrer en contact avec son mari, mais la présence qu\'elle ressent devient de plus en plus terrifiante. La famille Finley est alors confrontée à un démon particulièrement agressif.', 2009, 2.99, 88, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(13, 'Des serpents dans le train', 'Une femme est victime d\'une malédiction maya, qui entraîne l\'éclosion d’œufs de serpents dans son ventre. Ces animaux s\'échappent. Pour les retrouver, elle rejoint un chaman maya à Los Angeles pour annuler la malédiction. Elle récupère les serpents et les transporte avec elle dans un vase, à bord d\'un train. Des bandits attaquent celui-ci, laissant les serpents s\'échapper, et mettant en danger les autres passagers.', 2006, 2.99, 91, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(14, 'War Space: La menace Predator fantôme', 'Avant de devenir un célèbre chevalier Jedi, et bien avant de se révéler l\'âme la plus noire de la galaxie, Le major Dutch Schaeffer, spécialisé dans les opérations de commando, est chargé de délivrer trois civils américains retenus par des rebelles en Amérique latine. Chemin faisant, entre les alligators et les lianes, Dutch et ses hommes découvrent qu\'ils ont été abusés et qu\'ils doivent en réalité détruire une base secrète des guérilleros.  La Force est déjà puissante en lui et il est un remar', 1999, 6.99, 99, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(15, 'War Space: L\'empire de L\'étoile du levant contre-a', 'Le premier épisode précédant la saga déjà culte War Space', 2003, 6.99, 93, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(16, 'Atlantic Rim: World\'s end', 'Une gigantesque créature des mers menace de s\'attaquer à la côte Est américaine.', 2015, 3.99, 81, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(17, 'Atlantic Rim: Résurrection', 'Des créatures surpuissantes attaquent la ville de Los Angeles.', 2018, 3.99, 86, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(18, 'The Final Level: Escaping Rancala', 'Lorsque la propriétaire d\'une salle d\'arcade se rend compte que son frère a été transporté dans un jeu vidéo dangereux, elle et ses deux meilleurs amis le suivent dans le monde virtuel, combattant des créatures dangereuses.', 2019, 2.99, 87, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(19, 'Triassic World', 'Des scientifiques parviennent à donner la vie à des dinosaures afin de leur prendre leurs organes et de sauver des humains. Mais quand les créatures s\'échappent, les scientifiques vont devoir se battre pour sauver leur vie.', 2021, 3.99, 89, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(20, 'Metal Man', 'Le Dr Arthur Blake travaille sur une armure révolutionnaire dont un méchant fabricant d\'armes souhaite s\'emparer. Il prend comme assistant le jeune Kyle Finn, un étudiant choisi entre tous car il a une très forte notion du Bien et du Mal, et lui fait revêtir l\'armure. Kyle devient ainsi Metal Man, un super héros aux super pouvoirs indéterminés.', 2008, 5.99, 93, );
INSERT INTO `movie` (`IDMovie`, `MovieName`, `MovieDescription`, `MovieReleaseYear`, `MoviePrice`, `MovieDuration`, `MoviePoster`) VALUES
(21, 'Ape vs Monster', 'Un singe s\'écrase sur la Terre, ce qui crée une boue qui lui permet, ainsi qu\'à un scorpion de passage, d\'atteindre une taille gigantesque, ce qui entraîne une lutte entre eux pour la domination du monde.', 2023, 4.99, 88, );
